function setStroke(countries,color){
    for(var i in countries){
        countries[i].attr({'stroke':color})
    }

}

function setFill(countries,color){
    for(var i in countries){
        countries[i].attr({'fill':color})
    }

}


function createTags(){
    var tags = [];
    for(var i = 1961; i < 2000; i++){
        tags.push({label:i.toString(), value:i});
    }
    return tags;
}

function getRaph(id){
    if(id == 'SOM'){
        return som;
    }
    if(id == 'ETH'){
        return eth;
    }

    if(id == 'DJI'){
        return dji;
    }

    if(id == 'KEN'){
        return ken;
    }
    return som;
    
}

