function doChart(country,data,cats){
    if(chart){
        chart.destroy();
    }
    chart = new Highcharts.Chart({
      chart: {
         backgroundColor:'#f5f5f5',
         renderTo: 'chart',
         defaultSeriesType: 'line',
         marginRight: 10,
         marginBottom: 40,
         marginTop: 90,
         height:300,
         width:550
         
      },

      colors:['#157DEC'],


      title: {
         text: country + ' Monthly Average Precipitation',
         x: -20 //center
      },
      subtitle: {
         text: 'Source: World Bank SDNIS',
         x: -20
      },
      xAxis: cats,
      yAxis: {
         title: {
            text: 'Precipitation (mm)'
         },
         
         plotLines: [{
            value: 0,
            width: 1,
            color: '#808080'
         }]
      },
      tooltip: {
         formatter: function() {
                   return '<b>'+ this.series.name +'</b><br/>'+
               this.x +': '+ this.y +' mm';
         }
      },
      credits:{enabled:false},
      legend: {
         enabled:false
      },
      series: data
   });
}

